import React from "react";

function TotalCard(props) {
  const AddedTotals = () => {
    console.log("This --> ", props.totals);
  };
  return (
    <div>
      <p>{props.totals}</p>
      {AddedTotals()}
    </div>
  );
}

export default TotalCard;
